$(document).ready(function() {
	if (typeof enable_js_lang != 'undefined') {
		$('ul#first-currencies li:not(.selected)').css('opacity', 0.3);
		$('ul#first-currencies li:not(.selected)').hover(function() {
			$(this).css('opacity', 1)
		}, function() {
			$(this).css('opacity', 0.3)
		})
	}
	if (typeof enable_js_currency != 'undefined') {
		$("#setCurrency").mouseover(function() {
			$(this).addClass("countries_hover");
			$(".currencies_ul").addClass("currencies_ul_hover")
		});
		$("#setCurrency").mouseout(function() {
			$(this).removeClass("countries_hover");
			$(".currencies_ul").removeClass("currencies_ul_hover")
		})
	}
	if (typeof js_country != 'undefined') {
		$("#countries").mouseover(function() {
			$(this).addClass("countries_hover");
			$(".countries_ul").addClass("countries_ul_hover")
		});
		$("#countries").mouseout(function() {
			$(this).removeClass("countries_hover");
			$(".countries_ul").removeClass("countries_ul_hover")
		})
	}
})

function setCurrency(id_currency) {
	$.ajax({
		type: 'POST',
		headers: {
			"cache-control": "no-cache"
		},
		url: prestashop.urls.base_url + 'index.php' + '?rand=' + new Date().getTime(),
		data: 'controller=change-currency&id_currency=' + parseInt(id_currency),
		success: function(msg) {
			location.reload(!0)
		}
	})
};
$(document).ready(function() {
	floatHeader();
	backtotop()
	if (prestashop.page.page_name == 'category') {
		setDefaultListGrid()
	}
	if (typeof(products_list_functions) != 'undefined') {
		for (var i = 0; i < products_list_functions.length; i++) {
			products_list_functions[i]()
		}
	}
});
$(document).on('click', '.leo_grid', function(e) {
	e.preventDefault();
	$('#js-product-list .product_list').removeClass('list');
	$('#js-product-list .product_list').addClass('grid');
	$(this).parent().find('.leo_list').removeClass('selected');
	$(this).addClass('selected');
	var configName = LEO_COOKIE_THEME + '_grid_list';
	$.cookie(configName, 'grid', {
		expires: 1,
		path: '/'
	})
});
$(document).on('click', '.leo_list', function(e) {
	e.preventDefault();
	$('#js-product-list .product_list').removeClass('grid');
	$('#js-product-list .product_list').addClass('list');
	$(this).parent().find('.leo_grid').removeClass('selected');
	$(this).addClass('selected');
	var configName = LEO_COOKIE_THEME + '_grid_list';
	$.cookie(configName, 'list', {
		expires: 1,
		path: '/'
	})
});

function setDefaultListGrid() {
	if ($.cookie(LEO_COOKIE_THEME + '_grid_list') == 'grid') {
		$('.leo_grid').trigger('click')
	}
	if ($.cookie(LEO_COOKIE_THEME + '_grid_list') == 'list') {
		$('.leo_list').trigger('click')
	}
}

function processFloatHeader(headerAdd, scroolAction) {
	if (headerAdd) {
		$("#header").addClass("navbar-fixed-top");
		var hideheight = $("#header").height() + 120;
		$("#page").css("padding-top", $("#header").height());
		setTimeout(function() {
			$("#page").css("padding-top", $("#header").height())
		}, 200)
	} else {
		$("#header").removeClass("navbar-fixed-top");
		$("#page").css("padding-top", '')
	}
	var pos = $(window).scrollTop();
	if (scroolAction && pos >= hideheight) {
		$("#topbar").addClass('hide-bar');
		$(".hide-bar").css("margin-top", -$("#topbar").height());
		$("#header-main").addClass("mini-navbar")
	} else {
		$("#topbar").removeClass('hide-bar');
		$("#topbar").css("margin-top", 0);
		$("#header-main").removeClass("mini-navbar")
	}
}

function floatHeader() {
	if (!$("body").hasClass("keep-header") || $(window).width() <= 990) {
		return
	}
	$(window).resize(function() {
		if ($(window).width() <= 990) {
			processFloatHeader(0, 0)
		} else if ($(window).width() > 990) {
			if ($("body").hasClass("keep-header"))
				processFloatHeader(1, 1)
		}
	});
	var headerScrollTimer;
	$(window).scroll(function() {
		if (headerScrollTimer) {
			window.clearTimeout(headerScrollTimer)
		}
		headerScrollTimer = window.setTimeout(function() {
			if (!$("body").hasClass("keep-header")) return;
			if ($(window).width() > 990) {
				processFloatHeader(1, 1)
			}
		}, 100)
	})
}

function backtotop() {
	$("#back-top").hide();
	$(window).scroll(function() {
		if ($(this).scrollTop() > 100) {
			$('#back-top').fadeIn()
		} else {
			$('#back-top').fadeOut()
		}
	});
	$('#back-top a').click(function() {
		$('body,html').animate({
			scrollTop: 0
		}, 800);
		return !1
	})
}
$(function() {
	$('#click_show_search').click(function(e) {
		e.stopPropagation();
		if ($('#search_widget').hasClass('showsearch')) {
			$('#search_widget').removeClass('showsearch')
		} else {
			$('#search_widget').addClass('showsearch')
		}
	});
	$('#search_widget').click(function(e) {
		e.stopPropagation()
	});
	$('#page').click(function() {
		if ($('#search_widget').hasClass('showsearch')) {
			$('#search_widget').removeClass('showsearch')
		}
	})
})